                    <script>

                    pi = Math.PI;
                    seqLength = 114065

                    var degreeScale = d3.scale.linear()
                                          .domain([0, seqLength])
                                          .range([0,360])
                    ;

                    var data = JSON.parse(document.getElementById('data').innerHTML);

                    var arc = d3.svg.arc()
                        .innerRadius(function(d, i){return d.inner;})
                        .outerRadius(function(d, i){return d.outer;})
                        .startAngle(function(d, i){return degreeScale(d.start) * (pi/180);})
                        .endAngle(function(d, i){return degreeScale(d.end) * (pi/180);})
                    ;

                    var width = 1600
                    var height = 800

                    var chart = d3.select("body").append("svg:svg")
                        .attr("width", width)
                        .attr("height", height)
                        .call(d3.behavior.zoom().on("zoom", function () {
                                chart.attr("transform", "translate(" + d3.event.translate + ")" + " scale(" + d3.event.scale + ")")
                                }))
                        .append("svg:g")
                    ;

                    var div = d3.select("body").append("div")
                        .attr("class", "tooltip")
                        .style("opacity", 0)
                    ;

                    var ringShell = chart.append("g")
                                         .attr("transform", "translate(" + width / 2 + "," + height / 2 + ")");

                    var textShell = chart.append("g")
                                         .attr("transform", "translate(" + width / 2 + "," + height / 2 + ")");

                    ringShell.selectAll("path")
                        .data(data)
                        .enter().append("svg:path")
                        .style("fill", function(d, i){ return d.color; })
                        .style("opacity", 0.8)
                        .attr("d", arc)
                        .attr('pointer-events', 'none')
                        .on('mouseover', function(d) {
                                div.transition()
                                    .duration(200)
                                    .style("opacity", .9);
                                div .html(d.text)
                                    .style("left", (d3.event.pageX + 20) + "px")
                                    .style("top", (d3.event.pageY + 10) + "px");
                                })
                        .on('mouseout', function(d) {
                                div.transition()
                                    .duration(200)
                                    .style("opacity", 0)
                            })
                        .attr('pointer-events', 'visible')
                    ;

                    textShell.append("text")
                      .style("opacity", 0)
                      .style("text-anchor", "middle")
                      .style("font-size", "100%")
                      .style("font-weight", "bold")
                      .style("font-family", "times")
                      .attr("class", "inside")
                      .text(function(d) { return 'RB04-SZ584-1T-IncF-TET-114056'; })
